import './styles/App.css';
import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";


import Home from './pages/home';
import About from './pages/about';

// const route = [
//   {path: '/', name:'Home', Component: Home},
//   {path: '/about', name:'About', Component: About},
// ]

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
              <Home />
            </Route>
            <Route path="/about">
              <About />
            </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
